.ripple {
  display: block;
  position: absolute;
  overflow: hidden;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  pointer-events: none;
}

.ripple__background {
  background: rgba(255, 255, 255, 0.2);
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  opacity: 0;
  pointer-events: none;
}

.ripple__wave {
  background: rgba(255, 255, 255, 0.2);
  width: 0;
  height: 0;
  border-radius: 50%;
  position: absolute;
  top: 0;
  left: 0;
  z-index: 0;
  pointer-events: none;
}

/* FIXME */
ons-list-item .ripple__wave,
ons-list-item .ripple__background,
.button--material--flat .ripple__wave,
.button--material--flat .ripple__background {
  background: rgba(189, 189, 189, 0.3);
}

.ripple--light-gray__wave,
.ripple--light-gray__background {
  background: rgba(189, 189, 189, 0.3);
}


